import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';

const IndividualProjectTemplate = () => {
    const { id } = useParams(); // Взимаме ID на проекта от URL параметрите
    const [project, setProject] = useState(null);
    const [buildings, setBuildings] = useState([]); // Съхраняваме данни за сградите
    const [parcel, setParcel] = useState(null); // Съхраняваме данни за парцела
    const [error, setError] = useState(null); // Съхраняваме евентуални грешки

    useEffect(() => {
        const fetchProjectAndBuildings = async () => {
            try {
                // Първо правим заявката за проекта
                const projectResponse = await axios.get(`http://localhost:8080/projects/${id}`);
                setProject(projectResponse.data); // Запазваме данните за проекта в state

                // Вземаме ID на парцела от респонса за проекта
                const parcelId = projectResponse.data.parcelId;

                // Правим GET заявка за сградите по parcelId
                const buildingsResponse = await axios.get(`http://localhost:8080/buildings/allByParcel/${parcelId}`);
                setBuildings(buildingsResponse.data); // Запазваме данните за сградите в state

                // Ако заявката за сградите е успешна, правим GET заявка за парцела по parcelId
                const parcelResponse = await axios.get(`http://localhost:8080/parcels/${parcelId}`);
                setParcel(parcelResponse.data); // Запазваме данните за парцела в state
            } catch (error) {
                console.error('Error fetching project, buildings, or parcel:', error);
                setError('Error fetching data'); // Запазваме грешка в state
            }
        };

        fetchProjectAndBuildings();
    }, [id]);

    if (error) {
        return <p>{error}</p>;
    }

    if (!project) {
        return <p>Loading project...</p>;
    }

    return (
        <div>
            <h1>Project: {project.title}</h1> {/* Визуализиране на заглавието на проекта */}

            <h2>Buildings:</h2>
            {buildings.length > 0 ? (
                <ul>
                    {buildings.map((building) => (
                        <li key={building.id}>{building.title}</li> // Визуализиране на заглавието на всяка сграда
                    ))}
                </ul>
            ) : (
                <p>No buildings found for this parcel.</p>
            )}

            {parcel && ( // Визуализираме данните за парцела само ако е успешно зареден
                <div>
                    <h2>Parcel Information:</h2>
                    <p><strong>ID:</strong> {parcel.id}</p>
                    <p><strong>EIK:</strong> {parcel.eik}</p>
                    <p><strong>Address:</strong> {parcel.address}</p>
                    <p><strong>Area:</strong> {parcel.area} m²</p>
                    <p><strong>Compensated:</strong> {parcel.isCompensated ? 'Yes' : 'No'}</p>
                    <p><strong>Regular:</strong> {parcel.isRegular ? 'Yes' : 'No'}</p>
                    <p><strong>Percentage of Compensation:</strong> {parcel.percentageOfCompensation}%</p>
                    <p><strong>With Electricity and Water:</strong> {parcel.withElectricityAndWater ? 'Yes' : 'No'}</p>
                    <p><strong>Price in BGN:</strong> {parcel.priceBgn} BGN</p>
                    <p><strong>Price in EUR:</strong> {parcel.priceEur} EUR</p>
                </div>
            )}
        </div>
    );
};

export default IndividualProjectTemplate;
